										dataElements.push({id:"id-cf86274ded9a4a2f9a41a0a780f293f8", type:"Capability", specialization:decodeURL(""), name:decodeURL("IT+Application+Framework"), documentation:decodeURL("Finally%2C+the+IT+Application+Framework+capability+provides+the+necessary+capabilities+for+the+data+spaces+to+deploy+the+building+blocks+in+accordance+with+the+proposed+architecture+%28e.g.+API+Gateway%2C+circuit+breaker%2C+service+mesh%2C+etc.%29.%0D%0A%0D%0ACrucially%2C+the+Integration+layer+acts+as+an+entry+door+towards+the+other+layers.+Below+sections+describe+how+the+Data+and+Infrastructure+layer+are+organised.+The+data+layer+provides+blocks+related+to+applications+and+data%2C+whereas+the+infrastructure+layer+provisions+computing%2C+storage%2C+and+other+infrastructure+resources.+When+a+consumer+needs+to+access+any+of+the+building+block+belonging+to+the+Data+layer%2C+the+Access+control+%26+Trust+capability+is+triggered+to+assure+the+right+permissions+are+given.+Additionally%2C+authentication+and+authorization+mechanisms+are+a+prerequisite+for+executing+the+Data+layer+building+blocks%2C+such+as+the+Application+or+Data+sharing+capabilities.%0D%0A%0D%0AOnce+the+Integration+layer+confirms+the+identity+and+the+role+of+the+end+user%2C+the+contract+capability+of+the+administration+layer+is+activated+in+order+to+verify+the+terms+agreed+and+the+Service+Level+Agreements.+After+this+process%2C+data+building+blocks+can+be+executed.+The+explanation+above+concerning+data+building+blocks+is+applicable+to+the+Infrastructure+layer+building+blocks+in+case+the+consumer+is+intending+to+access+computing%2C+storage%2C+or+other+infrastructure+resources.+Nevertheless%2C+it+will+be+common+to+combine+data+and+infrastructure+resource+usage+by+means+of+a+distributed+execution.+It+must+be+noted+that+beyond+the+usage+of+data+and+infrastructure+resources+in+combination%2C+independent+use+of+infrastructure+or+data+alone+will+be+a+possibility+as+well.%0D%0A%0D%0AWhen+considering+the+security+and+orchestration+needs+for+the+global+usage+of+any+of+the+Data+and+Infrastructure+layers+building+blocks%2C+the+Integration+Security+and+Federation+management+will+be+responsible+of+the+correct+encryption+and+verification+deployments%2C+assuring+as+well+a+correct+allocation+and+interoperability+of+the+resources.+It+must+be+noted+however+that+both+the+Data+and+the+Infrastructure+layers+will+hold+their+own+local+orchestration+blocks+as+explained+in+their+respective+sections.")});

										dataElements.push({id:"id-f78f276589e242d996be709075a252ed", type:"BusinessService", specialization:decodeURL(""), name:decodeURL("Data+Orchestration"), documentation:decodeURL("https%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FAnnex%2B6%2B-%2BArchitecture%2Bbuilding%2Bblocks%0D%0AThe+main+building+block+for+taking+siloed+data+from+multiple+data+storage+locations%2C+%0D%0Acombining+them%2C+and+making+them+available+to+data+consumer+applications%0D%0A%0D%0Ahttps%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FData%2BOrchestration%0D%0AIn+the+context+of+the+MVP%2C+data+orchestration+refers+to+the+data+plane+component+responsible+for+the+actual+data+transfer+that+takes+place+after+a+contract+is+established+between+the+parties+through+the+connector%27s+control+plane.+This+orchestration+of+data+flow+is+a+crucial+step%2C+as+it+translates+contractual+agreements+into+real+actions+for+exchanging+data+between+a+source+and+a+destination.%0D%0A%0D%0AFor+the+MVP+release%2C+this+component+will+be+implemented+as+an+extension+of+the+EDC+connector%2C+it+has+been+depicted+as+an+external+entity+in+various+diagrams+and+system+architectures.+This+approach+underscores+the+goal+of+creating+an+external+and+independent+solution+that+is+agnostic+of+the+specific+connector+used.+Such+independence+is+achievable+as+long+as+the+connector+supports+the+IDSA+Dataspace+Protocol%2C+which+is+a+key+requirement+to+ensure+interoperability+within+distributed+ecosystems+like+sovereign+data+spaces+or+shared+data+infrastructures.%0D%0A%0D%0AThe+primary+role+of+this+orchestrator+is+to+serve+as+a+bridge+between+the+actual+data+source%2C+located+outside+of+the+Simpl+system%2C+and+the+designated+destination+where+the+data+is+intended+to+flow.+It+ensures+seamless+connectivity+between+these+two+points%2C+handling+the+complexities+of+transferring+data+across+systems+that+may+differ+in+protocols+and+technology.+Additionally%2C+the+orchestrator+is+designed+as+a+specific+component+tailored+to+each+type+of+data+source.+This+specialization+allows+to+externalize+the+technical+management+of+heterogeneous+data+sources+that+will+be+handled+in+the+Simpl+scenario%2C+reducing+complexity+and+promoting+flexibility+in+the+integration+of+various+data+ecosystems.")});

										dataElements.push({id:"id-fd38519e50b3445eb6be274c28dcf974", type:"BusinessService", specialization:decodeURL(""), name:decodeURL("VM+Provisioning"), documentation:decodeURL("https%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FAnnex%2B6%2B-%2BArchitecture%2Bbuilding%2Bblocks%0D%0ASimpl+provides+an+abstraction+layer+to+provision+Virtual+Machines+on+the+underlying+%0D%0Ainfrastructure.+The+end+users+may+select+the+virtual+machine%28s%29+which+are+the+most+%0D%0Atailored+for+their+needs+regarding+a+set+of+parameters+%28e.g.+operation+system%2C+memory+%0D%0Asize%2C+network+bandwidth%2C+etc.%29%0D%0A%0D%0Ahttps%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FContainer%2BProvisioning%0D%0AProvisioning+of+an+infrastructure+resource+is+identical+for+containers%2C+storage+and+VMs.+Details+are+provided+under+Containers+Provisioning+and+are+also+applicable+to+Storage+and+VMs.%0D%0AIn+the+first+step%2C+the+Infrastructure+Provider+%28or+APP%2FData+Providers%2C+upon+their+need%29+can+use+the+Deployment+Script+Management+to+add+their+deployment+scripts.+%0D%0AThese+scripts+are+Crossplane+configuration+files%2C+that+at+the+time+of+execution%2C+will%3A%0D%0A%0D%0AA%29+Provision+the+infrastructure+resources+%28VM%2C+Container+or+Storage%29%3B%0D%0AB%29+Deploy+Applications+over+the+infrastructure+resources+%28if+needed%29%3B%0D%0AC%29+Load+data+sets+or+images+on+the+infrastructure+resource+%28if+needed%29.+%0D%0A%0D%0AAfter+adding+the+deployment+script+%28via+the+available+UI+or+the+API%29%2C+the+DeploymentScriptID%2C+which+is+a+unique+ID+for+that+deployment+script+will+be+returned.+%0D%0A%0D%0A%0D%0A%0D%0AIn+the+second+step%2C+at+the+time+of+creating+infrastructure+offerings+%28or+bundles+of+app%2Fdata+%2B+infrastructure%2C+as+it+would+be+required+for+use+cases+explained+in+BP+09A+and+BP+09B%29%2C+the+DeploymentScriptID+is+being+added+to+the+Self-Description.+%0D%0A%0D%0A%0D%0A%0D%0AIn+the+third+step%2C+when+the+offer+has+been+selected+and+successfully+contracted%2C+the+Infrastructure+Provisioner+API+%28the+same+API+that+handles+the+addition%2Fremoval+and+modifications+of+the+Deployment+Scripts+in+step+1%29+is+being+called%2C+and+the+DeploymentScriptID+will+be+passed+to+that+API+for+execution.+%0D%0A%0D%0ATherefore%2C+that+DeploymentScriptID+is+being+validated%2C+and+if+the+validation+is+successful%2C+will+be+executed.+The+infrastructure+Provisioner+Module+will+%28as+explained+above%29%3A%0D%0A%0D%0AA%29+Provision+the+infrastructure+resources+%28VM%2C+Container+or+Storage%29.%3B%0D%0AB%29+Deploy+Applications+over+the+infrastructure+resources+%28if+needed%29%3B%0D%0AC%29+Load+data+sets+or+images+on+the+infrastructure+resource+%28if+needed%29.+%0D%0A%0D%0AAnd+will+share+back+the+access+data+with+the+consumer.+%0D%0A%0D%0A%0D%0A%0D%0AThe+communication+between+the+triggering+module+and+the+infrastructure+provisioner+is+done+via+a+message+broker%2C+to+keep+the+process+asynchronous.+%0D%0A%0D%0Ahttps%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FACV%2B08%2B-%2BInfrastructure%2BResource%2BConsumption")});

										dataElements.push({id:"id-05003d34b2c042ceae5db3eb98e9b607", type:"Grouping", specialization:decodeURL(""), name:decodeURL("Integration+Layer"), documentation:decodeURL("https%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FHigh%2BLevel%2BArchitecture%0D%0A%0D%0AThe+integration+layer+provides+the+capabilities+for+participants+to+securely+and+trustfully+integrate+with+each+other%0D%0A%0D%0AConsumers+can+find+resources+of+a+data+space+through+the+tooling+provided+by+the+Resource+discovery+capability.+First%2C+providers+make+their+resources+%28data%2C+application+or+infrastructure%29+discoverable+by+submitting+well-structured+metadata+description+of+their+resources+%E2%80%93+in+a+standardised+format.+Then+consumers+can+query+the+catalogues+to+find+suitable+resources+within+the+data+space.+These+catalogues+describe+the+content+of+the+resources%2C+how+to+consume+them%2C+and+the+policies+that+apply+on+this+usage.%0D%0A%0D%0AIn+the+widespread+context+of+Simpl-Open%2C+Security+is+crucial+to+protect+EU+resources.+As+it+will+be+described+in+Annex+6%2C+security+capabilities+are+constantly+active.+The+agreed+level+of+security+encryption+and+integrity+on+every+data+transmission+or+resource+deployment+must+be+granted+for+the+consumer+at+any+time.+For+this+reason%2C+any+provision+of+a+resource+will+be+inevitably+deployed+along+with+the+security+block%2C+providing+strong+end-to-end+security+guarantees+of+all+data+that+is+handled+by+Simpl-Open.%0D%0A%0D%0ARelated+to+the+security+capabilities%2C+the+functions+gathered+by+Access+control+%26+Trust+capability+will+be+constantly+required+whenever+any+participant++%28consumer%2C+provider+or+governance+authority%29+accesses+Simpl-Open.+Mapping+end+user+roles+with+participant+attributes+%28Role-Based+Access+Control+-+RBAC+%26+Attribute-Based+Access+Control+-+ABAC%29%2C+as+well+as+authorizations+to+proceed+with+an+action+are+addressed+here.+In+this+sense%2C+every+relation+of+the+user+with+a+data+layer+building+block+or+infrastructure+provisioning+is+closely+screened+by+the+Access+Control+%26+Trust.+Simpl-Open+will+provide+identification%2C+authentication+and+authorization+%28IAA%29+building+block+for+communication+between+data+space+participants%2C+and+integrate+existing+IAA+systems+of+participating+organisations+for+IAA+of+users+within+the+organisation.+To+ensure+that+all+usage+policies+are+effectively+enforced+within+the+data+spaces%2C+Simpl-Open+provides+a+policy+enforcement+capability.+It+also+provides+the+necessary+capabilities+to+submit%2Freview%2Fapprove+onboarding+requests+and+deliver+to+the+applicant+the+necessary+security+credentials+to+join+a+data+space.%0D%0A%0D%0AThe+Network+capability+contains+building+blocks+for+the+establishment+of+secure+network+connections+using+technologies+like+virtual+private+networks.+Additionally+a+firewall+protects+unwarranted+access+to+Simpl-Open+components+and+backend+services.+These+network+capabilities+are+relevant+for+connecting+to+infrastructure+resources%2C+as+well+as+setting+up+the+communication+channels+for+data+and+application+transfers.%0D%0A%0D%0AThe+Federation+management+capability+encompasses+the+general+orchestration%2C+as+well+as+the+supervision+of+the+building+blocks.+It+will+oversee+that+the+main+principles+of+federation+and+interoperability+are+met+by+providing+the+means+to+connect+resources.+The+federation+management+will+encompass+the+needed+configuration+parameters+for+a+well-functioning+of+Simpl-Open+components.+Such+parameters+may+include+the+servers+to+connect+to%2C+rules+concerning+the+lifecycle+of+recorded+data%2C+network+configuration%2C+and+other+parameters.%0D%0A%0D%0AFinally%2C+the+IT+Application+Framework+capability+provides+the+necessary+capabilities+for+the+data+spaces+to+deploy+the+building+blocks+in+accordance+with+the+proposed+architecture+%28e.g.+API+Gateway%2C+circuit+breaker%2C+service+mesh%2C+etc.%29.%0D%0A%0D%0ACrucially%2C+the+Integration+layer+acts+as+an+entry+door+towards+the+other+layers.+Below+sections+describe+how+the+Data+and+Infrastructure+layer+are+organised.+The+data+layer+provides+blocks+related+to+applications+and+data%2C+whereas+the+infrastructure+layer+provisions+computing%2C+storage%2C+and+other+infrastructure+resources.+When+a+consumer+needs+to+access+any+of+the+building+block+belonging+to+the+Data+layer%2C+the+Access+control+%26+Trust+capability+is+triggered+to+assure+the+right+permissions+are+given.+Additionally%2C+authentication+and+authorization+mechanisms+are+a+prerequisite+for+executing+the+Data+layer+building+blocks%2C+such+as+the+Application+or+Data+sharing+capabilities.%0D%0A%0D%0AOnce+the+Integration+layer+confirms+the+identity+and+the+role+of+the+end+user%2C+the+contract+capability+of+the+administration+layer+is+activated+in+order+to+verify+the+terms+agreed+and+the+Service+Level+Agreements.+After+this+process%2C+data+building+blocks+can+be+executed.+The+explanation+above+concerning+data+building+blocks+is+applicable+to+the+Infrastructure+layer+building+blocks+in+case+the+consumer+is+intending+to+access+computing%2C+storage%2C+or+other+infrastructure+resources.+Nevertheless%2C+it+will+be+common+to+combine+data+and+infrastructure+resource+usage+by+means+of+a+distributed+execution.+It+must+be+noted+that+beyond+the+usage+of+data+and+infrastructure+resources+in+combination%2C+independent+use+of+infrastructure+or+data+alone+will+be+a+possibility+as+well.%0D%0A%0D%0AWhen+considering+the+security+and+orchestration+needs+for+the+global+usage+of+any+of+the+Data+and+Infrastructure+layers+building+blocks%2C+the+Integration+Security+and+Federation+management+will+be+responsible+of+the+correct+encryption+and+verification+deployments%2C+assuring+as+well+a+correct+allocation+and+interoperability+of+the+resources.+It+must+be+noted+however+that+both+the+Data+and+the+Infrastructure+layers+will+hold+their+own+local+orchestration+blocks+as+explained+in+their+respective+sections.")});
									dataFoldersContent.push({folderid:"id-23bddd444c85439fa13fad6857b68d46", contentid:"id-b2df658e696c40e5a5e30fe08af36c40", contenttype:"Grouping"});

										dataElements.push({id:"id-4241f26446e04fa89602d32ea1b0bed7", type:"Grouping", specialization:decodeURL(""), name:decodeURL("Governance+layer"), documentation:decodeURL("https%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FHigh%2BLevel%2BArchitecture%0D%0A%0D%0AThe+governance+layer+addresses+transversal+functionalities+that+apply+to+all+the+forementioned+layers+as+it+%0D%0Aprovides+means+of+protentional+contingency+against+issues+the+participants+might+find+while+using+the+SMP.+The+%0D%0Atwo+main+capabilities+in+this+layer+are+composed+of+human+taskforces+that+either+support+the+participants+in+%0D%0Afinding+solutions+to+technical+problems+or+trigger+a+response+action+against+security+threats+in+the+form+of+a+%0D%0AComputer+Security+Incident+Response+Team+%28CSIRT%29%0D%0A%0D%0AThe+capabilities+provided+in+the+governance+layer+enable+the+support+and+management+of+Simpl-Open.+The+governance+layer+can+be+divided+in+two+categories+of+governance+capabilities%3A+Support+and+CSIRT+%28Computer+Security+Incident+Response+Team%29.%0D%0A%0D%0AThe+Support+capability+is+associated+with+the+administration+layer+of+the+architecture+and+will+assist+Simpl-Open+end+users+when+issues+arise+during+installation+of+Simpl-Open+and+during+the+use+of+other+building+blocks+from+Simpl-Open.+Three+building+blocks+are+currently+foreseen+in+the+support+category%2C+the+first+building+block+is+a+Support+webpage+for+Simpl-Open+users.+The+second+support+building+block+is+a+Ticketing+system+where+Simpl-Open+end+users+will+be+able+to+log+and+keep+track+of+issues+regarding+Simpl-Open+and+the+third+building+block+is+a+Helpdesk+where+Simpl-Open+end+users+can+connect+to+in+case+issues+remain+unsolved.%0D%0A%0D%0AThe+Computer+Security+Incident+Response+Team+capability+is+the+second+category+of+governance+capabilities+which+includes+the+incident+response+and+threat+monitoring+building+blocks.+The+Incident+response+building+block+will+have+procedures+to+respond+to+security+incidents+to+restore+the+compromised+Simpl-Open+functionality+as+soon+as+possible.+The+second+building+block%2C+Threat+monitoring%2C+will+proactively+monitor+and+follow-up+on+possible+malicious+activities+that+could+affect+Simpl-Open+to+avoid+potential+security+breaches.")});

										dataElements.push({id:"id-206253c59d504b0d8855a736940c8335", type:"Grouping", specialization:decodeURL(""), name:decodeURL("Administration+Layer"), documentation:decodeURL("https%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FHigh%2BLevel%2BArchitecture%0D%0A%0D%0AThe+administration+layer+vertically+spans+the+data+and+infrastructure+layer.+It+provides+services+that+are+required+%0D%0Afor+the+well-functioning+of+those+layers%2C+as+well+as+the+SMP+as+a+whole.+These+services+regard+security%2C+%0D%0Aidentification+and+access+control%2C+monitoring%2C+and+more.+The+administration+layer+enables+data+spaces+to+federate+%0D%0Athe+different+actors+and+allows+actors+to+operate+their+components+in+the+data+space.%0D%0A%0D%0AThe+administration+layer+addresses+the+main+capabilities+that+will+assure+the+correct+delivery+of+capabilities+within+Simpl-Open.+Despite+being+depicted+as+isolated+bubbles%2C+capabilities+and+building+blocks+are+strongly+related+and+further+discussed+%28see+Annex+6%29.+The+function+of+this+layer+can+be+described+as+a+set+of+supervision+and+management+functions+that+will+lead+to+a+better+control+and+interoperability+of+the+rest+of+Simpl-Open+building+blocks.+Along+with+the+later+described+governance+layer%2C+it+will+play+an+executive+role+within+Simpl-Open.%0D%0A%0D%0AWhenever+a+consumer+accesses+a+resource+through+Simpl-Open%2C+the+Contracts+capability+will+determine+if+the+licenses+are+correctly+delivered.+It+will+also+register+the+billing+terms+and+will+manage+the+service+level+agreements+as+specified+by+the+providers%2C+as+well+as+managing+the+permissions+related+to+data+sharing.+The+usage+contracts+will+be+accessible+through+this+Administration+layer+every+time+a+consumer+requests+a+data+or+computing+resource.%0D%0A%0D%0AThe+Logging%2C+Monitoring+and+Reporting++capabilities+are+strongly+interconnected.+In+the+case+of+Logging%2C+it+is+regarded+as+the+real+time+information+collection%2C+while+Monitoring+is+about+screening+the+collected+information+and+registering+alerts+and+usage+information+concerning+other+layer%C2%B4s+building+blocks%2C+as+well+as+energy+and+quality+of+service+optimization.+On+the+other+hand%2C+the+Reporting+capability+will+handle+the+historical+record+of+such+information%2C+as+well+as+the+general+platform+usage%2C+allowing+the+relevant+stakeholders+to+export+and+log+the+extraction+of+the+information+obtained.+These+two+capabilities+could+be+visualised+as+a+supervision+of+the+processes+taking+part+at+every+layer+level+within+Simpl-Open.+Should+additional+action+be+taken%2C+the+Governance+Authority+will+resolve+the+situation+with+the+assistance+of+other+Administration+layer+blocks+such+as+Security+or+Contracts.%0D%0A%0D%0AIn+order+to+analyse+if+the+resources+given+by+Simpl-Open+are+meeting+contracts%2C+access+or+security+requirements%2C+an+auditing+tool+in+the+Audit+capability+will+be+capable+of+receiving+information+inputs+from+the+logging%2C+reporting+and+monitoring+building+blocks.+By+comparing+what+is+expected+from+Simpl-Open+resources+and+what+is+actually+happening+at+a+resource+delivery+level%2C+the+audit+capability+will+interact+with+the+Logging%2C+Reporting+and+Monitoring+capabilities.%0D%0A%0D%0AThe+Administration+layer+will+perform+consistent+and+continuous+analysis+of+the+usage+with+the+help+of+the+Reporting+and+Monitoring+capabilities.+Along+with+the+Auditing+capability%2C+the+Administration+capabilities+will+extract+valuable+information+about+the+resources+exchanged+between+the+consumer+and+the+data%2C+application%2C+and+infrastructure+provider%28s%29.+This+will+include+analysis+of+the+usage+kept+in+metrics+logging+and+real-time+monitoring%2C+which+will+be+transferred+to+the+reporting+capability+for+a+wider+history+data+recording.+In+this+reporting+function%2C+performance+of+deployed+resources%2C+the+level+of+efficiency+or+the+usage+of+the+platform+and+the+sustainable+utilization+will+be+supervised+by+the+administration.")});

										dataElements.push({id:"id-7dcd6555682445ad978800bef94536d8", type:"Grouping", specialization:decodeURL(""), name:decodeURL("Infrastructure+Layer"), documentation:decodeURL("https%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FHigh%2BLevel%2BArchitecture%0D%0A%0D%0AThe+infrastructure+layer+has+similar+responsibilities+to+the+data+layer+for+managing+infrastructure+assets.+This+layer+allows+the+SMP+%0D%0Ato+connect+to+third-party+infrastructure+services%2C+such+that+end+users+can+execute+applications+on+them.+The+%0D%0Amiddleware+does+not+provide+infrastructure+itself%2C+but+allows+infrastructure+providers+to+open+up+internal+%0D%0Ainfrastructure+towards+data+space+participants.+Both+elemental+computing+and+storage+resources+%28e.g.+virtual+%0D%0Amachines%2C+file+system+storage%29+as+well+as+PaaS+services+%28e.g.+databases%2C+AI+hardware%29+can+be+provided.+The+%0D%0Ainfrastructure+layer+allows+end+users+to+discover%2C+utilize%2C+and+manage+infrastructure+services+offered+by+%0D%0Ainfrastructure+providers%0D%0AThe+capabilities+provided+by+this+layer+enable+the+consumers+to+easily+provision+the+necessary+computing+and+storage+resources+to+execute+their+workloads+in+a+secure+and+energy-efficient+way.+%0D%0A%0D%0AThe+infrastructure+orchestration%2C+automates+the+provisioning+of+the+infrastructure+resources+to+enable+the+various+infrastructure+providers+to+interconnect+and+get+exposed+via+a+standard+interface.+The+distributed+execution%2C+allows+the+consumer+to+deploy+applications+and+execute+computations+close+to+the+data.%0D%0A%0D%0AThe+cloud+%26+edge+computing+capability+provides+the+opportunity+to+provision+various+resources+to+execute+computations+or+store+data+in+the+environment+of+their+choice.+The+platform-as-a-service+building+blocks+provide+several+database+engines+and+other+platform-level+resources.+Finally%2C+the+HPC+capability+permits+the+consumer+to+perform+complex+calculations+at+high+speed+by+providing+a+cluster+of+high-performance+computers.%0D%0A%0D%0AThe+infrastructure+building+blocks+can+be+easily+combined+with+each+other+to+create+even+more+value+for+the+consumer.+For+instance%2C+after+successfully+analysing+certain+data+with+the+help+of+the+provisioned+PaaS+analytical+resources+or+the+HPC+capability%2C+the+consumer+may+want+to+store+the+used+datasets+and%2For+the+results+of+their+calculations.+In+this+case%2C+the+PaaS+storage+building+block+can+easily+fulfil+the+storage+needs+of+the+end+user.+In+case+a+consumer+would+like+to+develop+a+stand-alone+application%2C+they+may+also+use+various+PaaS+resources+at+the+same+time.+They+can+leverage+the+different+storage+options+to+store+each+sort+of+data+in+the+most+efficient+manner+%28e.g.+the+transactional+data+in+a+transactional+database%2C+while+the+sensor+data+in+a+NoSQL+database%29.+Besides%2C+they+can+use+the+cloud+%26+edge+computing+capabilities+to+deploy+and+run+their+applications%2C+and+the+distributed+execution+capability+even+enables+them+to+run+the+code+close+to+the+edge.%0D%0A%0D%0AAdministration+layer+architecture%0D%0AThe+administration+layer+addresses+the+main+capabilities+that+will+assure+the+correct+delivery+of+capabilities+within+Simpl-Open.+Despite+being+depicted+as+isolated+bubbles%2C+capabilities+and+building+blocks+are+strongly+related+and+further+discussed+%28see+Annex+6%29.+The+function+of+this+layer+can+be+described+as+a+set+of+supervision+and+management+functions+that+will+lead+to+a+better+control+and+interoperability+of+the+rest+of+Simpl-Open+building+blocks.+Along+with+the+later+described+governance+layer%2C+it+will+play+an+executive+role+within+Simpl-Open.%0D%0A%0D%0AWhenever+a+consumer+accesses+a+resource+through+Simpl-Open%2C+the+Contracts+capability+will+determine+if+the+licenses+are+correctly+delivered.+It+will+also+register+the+billing+terms+and+will+manage+the+service+level+agreements+as+specified+by+the+providers%2C+as+well+as+managing+the+permissions+related+to+data+sharing.+The+usage+contracts+will+be+accessible+through+this+Administration+layer+every+time+a+consumer+requests+a+data+or+computing+resource.%0D%0A%0D%0AThe+Logging%2C+Monitoring+and+Reporting++capabilities+are+strongly+interconnected.+In+the+case+of+Logging%2C+it+is+regarded+as+the+real+time+information+collection%2C+while+Monitoring+is+about+screening+the+collected+information+and+registering+alerts+and+usage+information+concerning+other+layer%C2%B4s+building+blocks%2C+as+well+as+energy+and+quality+of+service+optimization.+On+the+other+hand%2C+the+Reporting+capability+will+handle+the+historical+record+of+such+information%2C+as+well+as+the+general+platform+usage%2C+allowing+the+relevant+stakeholders+to+export+and+log+the+extraction+of+the+information+obtained.+These+two+capabilities+could+be+visualised+as+a+supervision+of+the+processes+taking+part+at+every+layer+level+within+Simpl-Open.+Should+additional+action+be+taken%2C+the+Governance+Authority+will+resolve+the+situation+with+the+assistance+of+other+Administration+layer+blocks+such+as+Security+or+Contracts.%0D%0A%0D%0AIn+order+to+analyse+if+the+resources+given+by+Simpl-Open+are+meeting+contracts%2C+access+or+security+requirements%2C+an+auditing+tool+in+the+Audit+capability+will+be+capable+of+receiving+information+inputs+from+the+logging%2C+reporting+and+monitoring+building+blocks.+By+comparing+what+is+expected+from+Simpl-Open+resources+and+what+is+actually+happening+at+a+resource+delivery+level%2C+the+audit+capability+will+interact+with+the+Logging%2C+Reporting+and+Monitoring+capabilities.%0D%0A%0D%0AThe+Administration+layer+will+perform+consistent+and+continuous+analysis+of+the+usage+with+the+help+of+the+Reporting+and+Monitoring+capabilities.+Along+with+the+Auditing+capability%2C+the+Administration+capabilities+will+extract+valuable+information+about+the+resources+exchanged+between+the+consumer+and+the+data%2C+application%2C+and+infrastructure+provider%28s%29.+This+will+include+analysis+of+the+usage+kept+in+metrics+logging+and+real-time+monitoring%2C+which+will+be+transferred+to+the+reporting+capability+for+a+wider+history+data+recording.+In+this+reporting+function%2C+performance+of+deployed+resources%2C+the+level+of+efficiency+or+the+usage+of+the+platform+and+the+sustainable+utilization+will+be+supervised+by+the+administration.")});

										dataElements.push({id:"id-37da07095cc7405ebcdd83d198938dcf", type:"Grouping", specialization:decodeURL(""), name:decodeURL("Data+layer"), documentation:decodeURL("https%3A%2F%2Fconfluence.simplprogramme.eu%2Fdisplay%2FSIMPL%2FHigh%2BLevel%2BArchitecture%0D%0A%0D%0AThe+data+layer+encompasses+the+building+blocks+to+enable+the+exchange+of+data+assets+and+applications.+The+SMP+%0D%0Aoffers+data+consumers+the+means+to+access+different+types+of+data+from+different+providers%2C+enabling+%0D%0Ainteroperability+between+providers+and+consumers.+The+layer+contains+the+services+to+share+as+well+as+manage+%0D%0Adata+and+applications%2C+and+perform+basic+analysis%0D%0A%0D%0ATwo+prominent+capabilities+are+the+Application+sharing+and+Data+sharing.+These+contain+the+building+blocks+required+for+providers+and+consumers+to+exchange+both+data+and+applications.+The+capabilities+create+the+connection+between+stakeholders+to+share+data+and+application+resources.+The+data+sharing+capability+encompasses+several+functions+including+management+of+various+types+of+data+sharing%2C+from+transferring+a+single%2C+few+megabyte+file%2C+to+transferring+a+terabyte-sized+data+dump.+The+Simpl-Open+architecture+foresees+a+simple+data+transfer+mechanism+and+two+special+types+of+data+transfer%3A+bulk+transfer+and+data+streaming.+A+datastore+connector+handles+the+connection+to+the+backend+data+store+of+the+data+provider%2C+which+can+vary+from+a+simple+file+storage+to+a+relational+database+system.+Additionally%2C+this+layer+addresses+a+number+of+scenarios+where+Data+processing+tools+will+be+desirable+to+process+data+as+near+as+possible+to+the+source.+Among+these+tools%2C+data+anonymization+tools+support+data+providers+and+consumers+to+protect+the+privacy+of+data+owners.+On+top%2C+Data+governance+tools+are+offered+by+Simpl-Open+for+consumers+and+providers+who+can+verify+the+integrity+and+quality+of+the+required+datasets.%0D%0A%0D%0ASharing+applications+is+similar+to+sharing+data.+Indeed%2C+at+their+core%2C+applications+are+no+more+than+a+collection+of+data+that+is+marked+to+be+executable.+However%2C+specifics+of+application+sharing+come+in+terms+of+formats+and+the+fact+that+usually+multiple+files+need+to+be+combined+correctly+to+be+able+to+run+the+application.+It+also+adds+additional+considerations+to+handle+the+security+of+executable+code+and+the+trust+that+consumers+have+in+the+provided+application.+Simpl-Open+will+define+the+procedures+to+use+for+sharing+applications.+The+application+sharing+capability+considers+three+types+of+applications%3A+full-fledged+software+packages%2C+isolated+algorithms%2C+and+machine+learning+models.+Each+type+of+tool+comes+with+different+specifics+and+runtime+environment+requirements+that+Simpl-Open+should+adhere+to.%0D%0A%0D%0AAdditional+building+blocks+of+the+data+layer+orchestrate+data+resources+across+Simpl-Open+actors.+The+Data+orchestration+and+Distributed+execution+capabilities+allow+actors+to+pool+together+data+from+different+sources+and+manage+partial+sets+of+data+across+infrastructure+providers+when+executing+distributed+applications.+The+combination+of+these+capabilities+allows+consumers+to+gather+data+from+different+providers+and+spread+it+over+distributed+infrastructure+where+data+is+fed+into+an+application.")});
